defs.script:
function umlload(newLocation)
{
if (newLocation.charAt(0) != '#') {
if (newLocation.indexOf("://") > -1) {
window.parent.location.href = newLocation;
} else {
var tmp = window.parent.location.href;
tmp = tmp.substring(0, tmp.lastIndexOf("/") + 1);
window.parent.location.href = tmp.concat(newLocation);
}
} else {
window.parent.location.hash = newLocation;
}
}
